var handleDataTableAutofill=function(){"use strict";if(0!==$("#data-table").length){var t=$("#data-table").DataTable();new $.fn.dataTable.AutoFill(t,{mode:"both",complete:function(t){var a=t[t.length-1];$.gritter.add({title:'Table Column Updated <i class="fa fa-check-circle text-success m-l-3"></i>',text:t.length+' cells were altered in this auto-fill. The value of the last cell altered was: <span class="text-white">'+a.oldValue+'</span> and is now <span class="text-white">'+a.newValue+"</span>",sticky:!0,time:"",class_name:"my-sticky-class"})}})}},TableManageAutofill=function(){"use strict";return{init:function(){handleDataTableAutofill()}}}();